★シナノのウォーキング補助ポール！<br>
<br>
●握力が弱めの方も簡単に長さが調節でき、安全に固定できる、ボタンを押し込むラチェット式設計！<br>
●下段シャフトには身長の目盛りがついていますので、適切なポールの長さに調整可能。<br>
●平らで安定感のある先ゴムで、転倒防止効果を実感されながらより安全にウォーキングをお楽しみいただけます！<br>
●2本杖で両側から身体を支えると左右のバランスが均等になり、正しい姿勢を保ちます。<br>
●デザインもカラーによって異なり、見た目もオシャレに！<br>
<br>
■重量 約220g/1本<br>
■素材 アルミ合金<br>
■企画製造販売元 株式会社シナノ<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■使用長 80～114cm<br>
■対応身長 130～181cm<br>
<br>
<img src="http://image.rakuten.co.jp/outlet-grasshopper/cabinet/evidence/1605-1607/12553-evidence.jpg"><br>
