★シナノのウォーキングポール！<br>
<br>
●折りたたんだ時の携帯サイズが業界最短の32cm。A4用紙にすっぽり収まります。軽くコンパクトで、気軽に持ち運びできます。<br>
●長さを決めたら、レバーを閉じるだけ。ワンタッチで長さ固定ができて簡単。回して固定するタイプよりも、素早く簡単に長さ調節できます！<br>
●15cmの長さ調節機能つきで、柔軟に長さを変更可能！<br>
●ポールの先端についている先ゴムは、半球形状で360度どの角度からでもしっかりと接地！<br>
●先ゴムの底部分には6ブロックの溝加工が施され、濡れた路面でも滑りにくく、グレーチングにはまらない大きさなので、初めての方でも安心してお使い頂けます。<br>
※ショートサイズはレッドカラー、ロングサイズはシルバーカラーのみの展開です。<br>
<br>
■重量<br>
ショート：約235g/1本<br>
ロング：約255g/1本<br>
■素材 アルミ合金<br>
■企画製造販売元 株式会社シナノ<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■使用長<br>
ショート：90～105cm<br>
ロング：100～115cm<br>
■対応身長<br>
ショート：143～167cm<br>
ロング：159～183cm<br>
<br>
